import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import {Radio,FormControl,FormLabel,RadioGroup,Grid,Accordion,Typography,Paper,Box,Link,Checkbox,TextField,Button,FormControlLabel,AccordionSummary,Slider} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Logo from './assets/images/imagen_reportes.png';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: `url(${Logo})`,
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[20] : theme.palette.grey[700],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
	backgroundColor:'#438EB9'
  },
  heading: {
    fontSize: theme.typography.pxToRem(15),
    flexBasis: '33.33%',
    flexShrink: 0,
  }
}));

export default function App() {
  const classes = useStyles();
  const [expandedAccordion, setExpandedAccordion] = React.useState(true);
  const [edad, setEdad] = React.useState([1, 100]);
  const [sexo, setSexo] = React.useState("femenino");
  const handleChange = (panel) => (event, isExpanded) => {
    setExpandedAccordion(isExpanded ? panel : false);
  };
  const handleChangeEdad = (e, data) => {
    setEdad(data);
  };
  const handleChangeSexo = (e, data) => {
    setSexo(data);
  };
  function valuetext(value) {
	return value;
  }
  const Paciente = (props) => {
		return ( 

		<Accordion expanded={expandedAccordion === 'paciente'} onChange={handleChange('paciente')}> 
		<AccordionSummary
			expandIcon={<ExpandMoreIcon />}
			aria-controls="pacientebh-content"
			id="pacientebh-header"
		>
	  <Typography className={classes.heading}>Paciente</Typography>

	</AccordionSummary>
	<Typography>Seleccione un rango de edad </Typography>

		<Grid item md={4} >
		<Slider
			value={edad}
			onChange={handleChangeEdad}
			valueLabelDisplay="auto"
			aria-labelledby="range-slider"
			getAriaValueText={valuetext}
      />
		</Grid>
	 	<Grid item md={4} >
		 <FormControl component="fieldset">
      <FormLabel component="legend">Sexo</FormLabel>
		<RadioGroup aria-label="gender" name="sexo" value={sexo} onChange={handleChangeSexo}>
			<FormControlLabel value="femenino" control={<Radio />} label="Femenino" />
			<FormControlLabel value="masculino" control={<Radio />} label="Masculino" />
			<FormControlLabel value="ambos" control={<Radio />} label="Ambos" />

		</RadioGroup>
    </FormControl>
		</Grid> 


	  </Accordion>)
  }
  return (
    <Grid container component="main" className={classes.root}>
      <CssBaseline />
      <Grid item xs={false} sm={4} md={5} className={classes.image} />
      <Grid item xs={12} sm={8} md={7} component={Paper} elevation={6} square>
        <div className={classes.paper}>

          <Typography component="h1" variant="h5">
           Formulario para sacar reportes
          </Typography>
          <form className={classes.form} noValidate>
		  <Grid container spacing={1}>
		 	<Paciente />
		 </Grid>
		  <Accordion expanded={expandedAccordion === 'antecedentes'} onChange={handleChange('antecedentes')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="antecedentesbh-content"
				id="antecedentesbh-header"
			>
          <Typography className={classes.heading}>Antecedentes</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expandedAccordion === 'factores_de_riesgo'} onChange={handleChange('factores_de_riesgo')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="factores_de_riesgobh-content"
				id="factores_de_riesgobh-header"
			>
          <Typography className={classes.heading}>Factores de riesgo</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expandedAccordion === 'clinica'} onChange={handleChange('clinica')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="clinicabh-content"
				id="clinicabh-header"
			>
          <Typography className={classes.heading}>Clinica</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expandedAccordion === 'datos_angiograficos'} onChange={handleChange('datos_angiograficos')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="datos_angiograficosbh-content"
				id="datos_angiograficosbh-header"
			>
          <Typography className={classes.heading}>Datos angiograficos</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expandedAccordion === 'lesiones'} onChange={handleChange('lesiones')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="lesionesbh-content"
				id="lesionesbh-header"
			>
          <Typography className={classes.heading}>Lesiones</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expandedAccordion === 'procedimiento'} onChange={handleChange('procedimiento')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="procedimientobh-content"
				id="procedimientobh-header"
			>
          <Typography className={classes.heading}>Procedimiento</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              className={classes.submit}
            >
             Consultar
            </Button>


          </form>
        </div>
      </Grid>
    </Grid>
  );
}
